import UserSessionsData from '../core/UserSessionsData'

export default class UserSessionMapper {
    /**
     *
     * @param { object } json
     * @returns { new UserSessionsData }
     */
    static convertToSession(json) {
        return new UserSessionsData(json.userId, json.sessions)
    }
}
